import React from 'react';
import { Link } from 'react-router-dom';

function Home() {
  return (
    <div>
      <h1>Selamat Datang di HoneyMoney</h1>
      <Link to="/register">
        <button className="btn">Daftar</button>
      </Link>
      <Link to="/login">
        <button className="btn">Login</button>
      </Link>
    </div>
  );
}

export default Home;
